import React from 'react'
import styled, { css } from 'styled-components';

const BasicCircle = styled.css`
    width: 100px;
    height: 100px;
    border-radius: 50%;
    position: absolute;
    top: 400px;
    left: -100px;
    z-index: -1;
`;

const Circle = styled.div`
    ${BasicCircle}
    background-color: pink;
    position: absolute;
    animation: circle 20s linear alternate infinite;

    @keyframes circle {
        to{
            transform: translate(100vw, -100vh)
        }
    }
`;

const Circle2 = styled.div`
    width: 100px;
    height: 100px;
    border-radius: 50%;
    background-color: #4451d8;
    opacity: 0.7;
    position: absolute;
    top: -80px;
    left: -80px;
    z-index: -1;
    animation: circle2 20s linear alternate infinite;

    @keyframes circle2 {
        to{
            transform: translate(90vw, 100vh)
        }
    }
`;

const AnimatedShapes = () => {
  return (
      <>
        <Circle />
      </>
  )
}

export default AnimatedShapes
